import React, { useContext } from 'react'
import { Button } from '@material-ui/core';
import { QuestionnaireContext } from '../../contexts/QuestionnaireContext';

const RedoButton = () => {
  const { timeline, dispatchTimeline } = useContext(QuestionnaireContext);

  return (
    <Button disabled={timeline.future.length > 0 ? false : true} onClick={() => dispatchTimeline({ type: "REDO" })}>
      redo
    </Button>
  )
}

export default RedoButton;
